import "./App.css";
import { TextField, FormControl, Button } from "@mui/material";
import Footer from "./components/Footer";
import Navbar from "./components/Navbar";
import StudentList from "./components/StudentList";

const theme = createTheme({
  typography: {
    fontFamily: '"Bebas Neue", "PT Sans", Arial, sans-serif',
    h1: {
      fontSize: "3em",
      textTransform: "uppercase",
    },
    h3: {
      fontSize: "1.25em",
      textTransform: "uppercase",
    },
    h6: {
      fontSize: "1em",
      fontFamily: "Helvetica, sans-serif",
    },
    p: {
      fontSize: "1em",
      fontFamily: "Helvetica, sans-serif",
    },
  },
  palette: {
    primary: {
      light: "#ECF6FC", // background light blue
      main: "#105F9A", // theme blue
      dark: "#168BE2", // bright blue
      contrastText: "#FFFFFF",
    },
    secondary: {
      light: "#597992", // disabled blue
      main: "#062740", // dark blue
      accent: "#F5E410", // yellow
      contrastText: "#062740", // dark blue, text color
    },
  },
});

const fieldStyle = {
  background: "white",
};

function App() {
  return (
    <div className="App">
      <Navbar />
      <header className="App-header">
        <img
          src="/images/mylogo.png"
          className="App-logo"
          alt="logo"
          height="20px"
          padding="10px"
        />
        <FormControl>
          <TextField
            id="student-name-form"
            variant="outlined"
            label="Write a name"
            color="primary"
            sx={fieldStyle}
          ></TextField>
          <p>Enter a student's name and click "GENERATE"</p>
          <Button variant="contained"> Generate </Button>
        </FormControl>
        <StudentList />
      </header>
      <Footer />
    </div>
  );
}

export default App;
